import './App.css';
import React , { useState } from 'react';
function Star(isFilled){(
  <img 
      src={isFilled.isFavorite} 
      className="card--favorite"

      alt='#'
  />
)

}

function App() {
  const [contact,setContact]=useState({
    firstname:"Jhon",
    lstname:"Doe",
    phone:"+212627709544",
    email:"driss.lakhzani.ds@gmail.com",
    isFavorite:true
  })
  function toggleFavorite(){
    setContact(prevContact=>{
      return {...prevContact,isFavorite:!contact.isFavorite}
        })
  }
  const star=contact.isFavorite?"./images/start.png":"./images/empty-star.png";

  return (
    <main>
            <article className="card">
                <img src={"./images/Intern.JPG"} alt="#" className="card--image" />
                <div className="card--info">
                    <Star isFavorite={star} onClick={toggleFavorite}/>
                    <h2 className="card--name">
                        {contact.firstname} {contact.lstname}
                    </h2>
                    <p className="card--contact">{contact.phone}</p>
                    <p className="card--contact">{contact.email}</p>
                </div>

            </article>
        </main>
  )
};

export default App;
